function App() {
  return (
        <div className=" h-screen w-screen flex bg-gradient-to-tr from-cyan-400 to-purple-600 font-mono">
          {/* <h1 className="absolute text-5xl top-0 right-0 left-0 m-auto ">Welcome to tic tac toe</h1> */}
           {/* first division  */}
          <RoomComponent />
          {/* second division */}
          <div className="relative w-[50%]  top-5 left-32">
              <div className="w-[50%]  flex justify-center items-center flex-col gap-4">
                <p className="text-5xl">Your X player</p>

                <p>Your Turn : _____________</p>
                <p>game Staus : _____________</p>
                {/* grid  */}
                <div className="rounded-md grid grid-cols-3 gap-3 bg-yellow-500 p-3" >
                      {/* SingleGrid  */}
                      <div className="bg-slate-300 rounded-lg size-20 flex items-center justify-center">
                        <span className="text-5xl text-slate-500">X</span>
                      </div>

                </div>

              </div>
              {/* User login status  */}
              <div className="absolute bg-white top-6 right-6"> 
                  user Online status
              </div>
          </div>

        </div>
  );
}

export default App;
